import React from 'react'

class Lisitra extends React.Component{
    render(){
      return(
        <>
          <h2>{this.props.nom}</h2>
          <ul className="list-group">
            {this.props.datas.map(arg => (<li  className="list-group-item">{arg.nom}</li>))}
          </ul>
        </>
      )
    }
}

export default Lisitra
